mixed-port: 7890
allow-lan: false
mode: rule
log-level: info
dns:
  enable: false
  ipv6: false
  default-nameserver: [223.5.5.5, 119.29.29.29]
  enhanced-mode: fake-ip
  fake-ip-range: 198.18.0.1/16
  use-hosts: true
  nameserver: ['https://doh.pub/dns-query', 'https://dns.alidns.com/dns-query']
  fallback: ['https://doh.dns.sb/dns-query', 'https://dns.cloudflare.com/dns-query', 'https://dns.twnic.tw/dns-query', 'tls://8.8.4.4:853']
  fallback-filter: { geoip: true, geoip-code: CN, ipcidr: [240.0.0.0/4, 0.0.0.0/32] }
proxies:
  - { name: fr2c, server: chgo-fr2c.newliving.top, port: 443, type: trojan, password: 50d8d65d-9d7d-3830-864a-dad899e9c4a8, udp: true, network: ws, ws-opts: { path: /2024dc09-chrome-gooo-b9cf-836523956698 } }
  - { name: us1c, server: chgo-kr1c.newliving.top, port: 443, type: trojan, password: 50d8d65d-9d7d-3830-864a-dad899e9c4a8, udp: true, network: ws, ws-opts: { path: /2024dc09-chrome-gooo-b9cf-836523956698 } }

proxy-groups:
  - name: 🔰 节点选择
    type: select
    proxies:
      - ♻️ 自动选择
      - 🎯 不用代理
      - fr2c
      - us1c

  - name: ♻️ 自动选择
    type: url-test
    url: http://www.gstatic.com/generate_204
    interval: 300
    proxies:
      - fr2c
      - us1c

  - name: 🌍 国外媒体
    type: select
    proxies:
      - 🔰 节点选择
      - ♻️ 自动选择
      - 🎯 不用代理
      - fr2c
      - us1c

  - name: 🌏 国内媒体
    type: select
    proxies:
      - 🎯 不用代理
      - 🔰 节点选择
      - fr2c
      - us1c

  - name: Ⓜ️ 微软服务
    type: select
    proxies:
      - 🎯 不用代理
      - 🔰 节点选择
      - fr2c
      - us1c

  - name: 📲 电报信息
    type: select
    proxies:
      - 🔰 节点选择
      - 🎯 不用代理
      - fr2c
      - us1c

  - name: 🍎 苹果服务
    type: select
    proxies:
      - 🔰 节点选择
      - 🎯 不用代理
      - ♻️ 自动选择
      - fr2c
      - us1c

  - name: 🎯 不用代理
    type: select
    proxies:
      - DIRECT
  - name: 🛑 全球拦截
    type: select
    proxies:
      - REJECT
      - DIRECT
  - name: 🐟 境外网站
    type: select
    proxies:
      - 🔰 节点选择
      - 🎯 不用代理
      - ♻️ 自动选择
      - fr2c
      - us1c

